import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <div className={s.dialog}>Vadick</div>
        <div className={s.dialog}>Alina</div>
        <div className={s.dialog}>Chesterock</div>
        <div className={s.dialog}>Puppy</div>
        <div className={s.dialog}>Another puppy</div>
        <div className={s.dialog}>Cherepashka</div>
        <div className={s.dialog}>Another cat</div>
      </div>
      <div className={s.messages}>
        <div className={s.message}>Hi</div>
        <div className={s.message}>Mew mew</div>
        <div className={s.message}>Bark bark</div>
      </div>
    </div>
  );
};

export default Dialogs;
